const data = {
    products : [
        {
        id: '1',
        name: 'ABC',
        image: '/image/Product/1.jpg',
        price: '7.00'
        },
        {
            id: '2',
            name: 'ACB',
            image: '/image/Product/1.jpg',
            price: '8.80'
        },
        {
        id: '1',
        name: 'ASD',
        image: '/image/Product/1.jpg',
        price: '6.70'
        },
        {
            id: '1',
            name: 'ABC',
            image: '/image/Product/1.jpg',
            price: '13.70'
        }
    ]
}

export default data
